import React from 'react';
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBContainer, MDBMask, MDBView } from 'mdbreact';
import { BrowserRouter as Router } from 'react-router-dom';
import {
  BrowserRouter,
  Switch,
  Route,
  Link,
  NavLink,
} from "react-router-dom";
import SignIn from './SignIn';

import {
  MDBDropdownMenu,
  MDBDropdownItem,
  MDBNavbarLink,
} from 'mdb-react-ui-kit';



import { useState } from 'react';
import { useSelector } from 'react-redux';

import SignUp from './SignUp';
// export default withRouter(function FullPageIntroWithFixedNavbar()
 export default function FullPageIntroWithFixedNavbar()
{
  const [state,setState]=useState({ collapse: "false",isWideEnough: "false"});
    let IsCompany = useSelector((store) => {return store.Companies.company });

    return (
      <Router>
     
      <div>
        <header>
          
         
            <MDBNavbar color="indigo" dark expand="md" fixed="top">
              <MDBNavbarBrand href="/">
                <strong>Navbar</strong>
              </MDBNavbarBrand>
              {!state.isWideEnough && <MDBNavbarToggler onClick={onClick} />}
              <MDBCollapse isOpen={state.collapse} navbar>
                <MDBNavbarNav left>
                  <MDBNavItem active>
                <MDBNavbarLink><NavLink to="#">Home</NavLink></MDBNavbarLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavbarLink><NavLink to="#">Link</NavLink> </MDBNavbarLink>
                  </MDBNavItem>

                  <MDBNavItem>
                    <MDBNavbarLink><NavLink  to="/SignIn">Profile</NavLink></MDBNavbarLink>
                   {/* <MDBDropdownMenu>
                    <MDBDropdownItem>
                          <NavLink to="/showProducts">הצגת מוצרים </NavLink>
                     </MDBDropdownItem>
                     
                      </MDBDropdownMenu>  */}
                  </MDBNavItem>


                </MDBNavbarNav>
              </MDBCollapse>
            </MDBNavbar>
          

          <MDBView src="https://mdbootstrap.com/img/Photos/Others/img%20(50).webp">
            <MDBMask overlay="black-light" className="flex-center flex-column text-white text-center">
            </MDBMask>
          </MDBView>
        </header> 

        <main>
          <MDBContainer className="text-center my-5">
           
          </MDBContainer>
        </main>
      </div>
          <Switch>
            <Route path='/SignIn' exact component={SignIn}></Route> 
            <Route path='/SignUp' exact component={SignUp}></Route> 

          </Switch>     
     
      </Router>
    );
    }
// )
  

  const onClick= () => {
    setState( collapse= !state.collapse) 
  }
